export default function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [results, setResults] = useState([]);

  const handleSearch = () => {
    const filtered = allParts.filter(part =>
      part.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      part.partNumber.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setResults(filtered.slice(0, 5));
  };

  return (
    <div style={{ padding: 20, maxWidth: 1000, margin: 'auto' }}>
      <h1 style={{ textAlign: 'center' }}>OmegaPack Spare Parts Search</h1>
      <div style={{ margin: '20px 0', display: 'flex', gap: '10px' }}>
        <input
          style={{ flex: 1, padding: 10 }}
          type='text'
          placeholder='Search by name or part number'
          value={searchTerm}
          onChange={e => setSearchTerm(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </div>
      {results.length === 0 ? (
        <p style={{ textAlign: 'center', color: 'gray' }}>No results found.</p>
      ) : (
        results.map(part => (
          <div key={part.id} style={{ border: '1px solid #ccc', marginBottom: 10, padding: 15 }}>
            <h3>{part.name}</h3>
            <p><strong>Part Number:</strong> {part.partNumber}</p>
            <p><strong>Origin:</strong> {part.origin}</p>
            <p><strong>Brand:</strong> {part.brand}</p>
            <p><strong>Price:</strong> {part.price}</p>
            <button onClick={() => alert('Inquiry sent to OmegaPack!')}>Send Inquiry</button>
          </div>
        ))
      )}
    </div>
  );
}
